import "../styles/Navbar.css";
const Navbar = () => {
  return (
    <>

<nav className="navbar navbar-expand-lg bg-light header">
  <div className="container-fluid">
    <a className="navbar-brand" href="#">TV-flights</a>
    <div className="h-auth">
        <button className="h-item h-auth-btn h-login">Login</button>
        <button className="h-item h-auth-btn h-register">Register</button>
      </div>
  </div>
</nav>

    </>
  );
};

export default Navbar;
